BEGIN TRANSACTION;
CREATE TABLE PHRASES (    ID INTEGER,    WORD_ID INTEGER NOT NULL,    WORD_ORDER INTEGER DEFAULT 0,        PRIMARY KEY (ID, WORD_ID, WORD_ORDER),        FOREIGN KEY (WORD_ID) REFERENCES WORDS(ID));
CREATE TABLE PHRASES_PROB (    PHRASE_ID INTEGER NOT NULL,    PROBABILITY NUMBER DEFAULT 1,    ALPHA NUMBER DEFAULT 1,        FOREIGN KEY (PHRASE_ID) REFERENCES FHRASES(ID),        CHECK (PROBABILITY BETWEEN 0 AND 1));
CREATE TABLE WORDS (    ID INTEGER PRIMARY KEY,    WORD TEXT NOT NULL UNIQUE);
CREATE TABLE WORDS_PROB (    WORD_ID INTEGER NOT NULL,    PROBABILITY NUMBER DEFAULT 1,        FOREIGN KEY (WORD_ID) REFERENCES WORDS(ID),        CHECK (PROBABILITY BETWEEN 0 AND 1));
CREATE UNIQUE INDEX index_words ON words(word);
CREATE INDEX index_phrases ON phrases(word_id, word_order);
COMMIT;
